import React from "react";
import { Button, Container, Row } from 'react-bootstrap';
import logo from '../../assest/Logo.png'
import './header.css'

const Header = () => {
    return (
        <Container fluid>
          <Row>
              <p>Follow Us:   </p>
          <img src={logo} className="logoDisplay" style={{ width: '150px' }} />

          </Row>
                <hr></hr>
            
        </Container>
    );
}

export default Header;
